webpackJsonp([82118028741997],{4761:function(e,t){e.exports={pathContext:{group:[{node:{fields:{title:"The boy's coming and I'm close to tears",date:"26 Mar 2001",slug:"/2001-03-26-the-boys-coming-and-im-close-to-tears/",tags:"Y2001"},html:'<p><b>Here comes the castor</b><br />\nAnd even CNN takes note: <a href="http://europe.cnn.com/2001/WORLD/europe/03/24/germany.waste/index.html">Germany faces anti-nuclear clashes</a>, <a href="http://europe.cnn.com/2001/WORLD/europe/03/26/germany.nuclear/index.html">Germany braced for nuclear protest</a> Six containers of nuclear waste are on their way to Gorleben, 2 counties east of us.</p>'},next:{fields:{title:"Strange fear I ain't felt for years",date:"25 Mar 2001",slug:"/2001-03-25-strange-fear-i-aint-felt-for-years/"}},previous:{fields:{title:"Basically probability",date:"28 Mar 2001",slug:"/2001-03-28-basically-probability/"}}},{node:{fields:{title:"Strange fear I ain't felt for years",date:"25 Mar 2001",slug:"/2001-03-25-strange-fear-i-aint-felt-for-years/",tags:"Y2001"},html:"<p>Europe went on Daylight Savings Time today, in case you're wondering what we're doing up so early. North America starts next weekend, right?</p>\n<p>It's still awfully cold, though. Mid-30's and freezing rain. Yech!</p>\n<p>Considering I was half sick yesterday, I got a lot done. (Mama was full sick,so she couldn't help.) I fixed the lock on our mailbox (after 6 months), so we again comply with German postal secrecy and require at least a good screwdriver to break in (which is how we broke the original lock). And I hung a curtain in Christopher's bedroom in preparation for longer daylight. After all, the longer he sleeps, the longer we sleep.</p>"},next:{fields:{title:"Gotta walk for air",date:"24 Mar 2001",slug:"/2001-03-24-gotta-walk-for-air/"}},previous:{fields:{title:"The boy's coming and I'm close to tears",date:"26 Mar 2001",slug:"/2001-03-26-the-boys-coming-and-im-close-to-tears/"}}},{node:{fields:{title:"Gotta walk for air",date:"24 Mar 2001",slug:"/2001-03-24-gotta-walk-for-air/",tags:"Y2001"},html:'<p>Al is at his best when he tells about his patients. Here\'s the story of Art in the CCU (<a href="http://www.vfth.com/stories/storyReader$1171">Part 1</a> and <a href="http://www.vfth.com/stories/storyReader$1170">Part 2</a>) that I think my Mom will appreciate.</p>'},next:{fields:{title:"Skipping School",date:"23 Mar 2001",slug:"/2001-03-23-skipping-school/"}},previous:{fields:{title:"Strange fear I ain't felt for years",date:"25 Mar 2001",slug:"/2001-03-25-strange-fear-i-aint-felt-for-years/"}}}],pathPrefix:"",first:!1,last:!1,index:1012,pageCount:1101}}}});
